import React from "react";
import Particles from "@tsparticles/react";
import { loadFull } from "tsparticles";

const ParticlesTest = () => {
  const particlesInit = async (engine) => {
    console.log("ParticlesTest: initializing...");

    try {
      await loadFull(engine);
      console.log("ParticlesTest: particles loaded");
    } catch (err) {
      console.error("ParticlesTest: error during loadFull:", err);
    }
  };

  return (
    <Particles
      id="tsparticles"
      init={particlesInit}
      options={{
        fullScreen: {
          enable: true,
          zIndex: -1,
        },
        background: {
          color: "#0d47a1",
        },
        particles: {
          number: { value: 50 },
          size: { value: 3 },
          move: { enable: true, speed: 1 },
          links: { enable: true, color: "#ffffff", distance: 150 },
        },
      }}
    />
  );
};

export default ParticlesTest;
